import React from "react";

function Task(props) {
  return (
    <div
      style={{
        padding: "1px 5px 10px",
        backgroundColor: "rgb(75, 73, 73)",
        color: "white",
      }}
    >
      <img
        src="./images/01.jfif"
        style={{
          width: "100%",
          height: "150px",
          border: "1px solid white",
        }}
      />
      <h2>Abdulmalik</h2>
      <p>Job Name</p>
      <p>Email</p>
      <p>Website</p>
    </div>
  );
}

export default Task;
